script: |
  super -f text -I q12815.spq | sort > q12815.out

inputs:
  - name: q12815.spq
    data: |
      SELECT ALL - col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 - - - 76 NOT IN ( col2 + - col0, 10 / col1, + 53 );
  - name: tab1

outputs:
  - name: q12815.out
    data: |
      -59
      -68
      -96
